<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
    <script src="https://code.jquery.com/jquery-3.1.1.min.js"></script>
    <script>
        $(function() {

            let sampleDialog;

            sampleDialog = $('#dialog-content')
                .dialog({
                    width: 500,
                    //height: 300,
                    modal: true,
                    resizable: false,
                    title: 'Sample dialog',
                    buttons: [
                        { text: 'Append Content',
                            click: function() {
                                sampleDialog.append('<p>Here\'s dynamically added content.</p>');
                            }
                        }, { text: 'Remove select',
                            click: function() {
                                $('#select1').remove();
                            }
                        },
                        { text: 'Add Button',
                            click: function() {
                                var buttonEl = sampleDialog.parent().find('.ui-dialog-buttonset');
                                var id = 'btn-' + new Date().valueOf().toString();
                                buttonEl.append('<span class="ui-button-text dynamic-button" id="' + id + '">Click Me!</span>');
                                $('#' + id).button().click(function() {
                                    alert('Dynamically added button was clicked.');
                                });
                            }
                        },
                        { text: 'Remove Buttons',
                            click: function() {
                                $('.dynamic-button').remove();
                            }
                        }
                    ]
                });

            sampleDialog.dialog('open');

        });
    </script>
</head>
